    DogsById: {},
    DogsByTemperament: [],
    DogsByBreed: [],
    allDogs: [],


}


const reducer = (state = initialState, {type, payload}) => {
    switch (type) {
        case GET_BREED:
            return { 
                ...state, allDogs: payload
            };
        case GET_ID:
            return  {

                ...state, DogsById: payload
            };
